let mut write_cursor = Cursor::new(&mut bytes);
out.write_to(&mut write_cursor, ImageOutputFormat::Png) .unwrap(); bytes The last statement - a bare bytes - uses Rusts expression-based nature to mark bytes as the variable to be returned. If you feel more comfortable, you may use return bytes. The final code of the library should now read: use std::io::Cursor; use rustagram::image::io::Reader;
use rustagram::image::ImageOutputFormat;
use rustagram::{RustagramFilter, FilterType}; pub fn apply_filter(img: &[u8], filter: FilterType) -> Vec<u8> { log::debug!("image: {} bytes, filter: {:?}", img.len(), filter); let read_cursor = Cursor::new(img); let img = Reader::new(cursor) .with_guessed_format() .unwrap() .decode() .unwrap(); let out = img.to_rgba8().apply_filter(filter); let mut bytes: Vec<u8> = Vec::new(); let mut write_cursor = Cursor::new(&mut bytes); out.write_to(&mut write_cursor, ImageOutputFormat::Png) .unwrap(); bytes
} Now that we have a library let's use it in our CLI Some ideas on what to do next: Create further utility functions Extend the signature and return a Result

